import React, { useState } from "react";

interface FormData {
  email?: string;
  password?: string;
}

interface FormErrors {
  email: boolean;
}

const Login = () => {
  const [fromData, setFormData] = useState<FormData>();
  const [formErrors, setFormErrors] = useState<FormErrors>({ email: true });

  return <div>Login</div>;
};

export default Login;
